import React from "react";

const Seconddiv = ({ title, note, onDelete }) => {
  return (
    <div className="note-card">
      <h4>{title}</h4>
      <p>{note}</p>
      <button className="btn btn-primary plus-btn" onClick={onDelete}>
        -
      </button>
    </div>
  );
};

export default Seconddiv;
